script: |
  super -f text -I q1610.spq | sort > q1610.out

inputs:
  - name: q1610.spq
    data: |
      SELECT DISTINCT + col0 * ( cor0.col2 ) + - col0 + + ( ( - col0 ) ) AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q1610.out
    data: |
      175
      1872
      2844
